import React from "react";
import "./App.css";
import Navbar from "./components/Navbar";
import Services from "./components/services/Services";
import Projects from "./components/projects/Projects";
import Timeline from "./components/timeline/Timeline";
import Team from "./components/team/Team";
import Partners from "./components/partners/Partners";
import Footer from "./components/footer/Footer";
import HeaderNavs from "./components/headerNavs/HeaderNavs";
import NavbarToggle from "./components/navbarWithToggle/NavbarToggle";
import MainBack from "./components/mainBackground/Mainback";
import CardMain from "./components/team/CardMain";
import { Route, Switch } from "react-router-dom";

const AppHome = () => {
  return (
    <>
      <HeaderNavs />
      <Navbar />
      <NavbarToggle />
      <MainBack />
    </>
  );
};

const App = () => {
  return (
    <Switch>
      <div className="App">
        <Route path="/" component={AppHome} />
        <Route path="#service" component={Services} />
        <Route path="/projects" component={Projects} />
        <Route path="/timeline" component={Timeline} />
        <Route path="/team" component={Team} />
        {/* <Projects />
        <Timeline />
        <Team />
        <Partners />
        <Footer /> */}
      </div>
    </Switch>
  );
};

export default App;
